import profilPic from '../../utils/assets/ProfilePic.jpg'
import "./style.css"

function AboutMe() {
  return (
    <Container>
      <Row>
        <Col style={{marginTop: '50px'}}><Image src={profilPic} thumbnail /></Col>
        <Col style={{marginTop: '50px'}}>
          <div className="description">
            <div className="content">
                I am a Full Stack coding student from Springfield, Massachussets. I have been an automotive mechanic for 7 years.
                <br />
                When I am not 
            </div> 
          </div>
        </Col>
      </Row>

    </Container>
  );
}

export default AboutMe;
